import React from "react";

export const AboutPage = () => {
  return (
    <div className="about" id="about-wrapper">
      <div className='about-top-container'>
        <div className='top-div-first'>
        <h3>Education</h3>
        </div>
        <div className='top-div-second'>
          <img
            className="mypic"
            src={process.env.PUBLIC_URL + "/mypic.jpeg"}
            alt="pic"
          />
        </div>
        <div className='top-div-third'> SKills</div>
      </div>
      <div className='about-bottom-container'>
        <div className='bottom-div-first'>Bottom div first</div>
        <div className='bottom-div-second'>Bottom div second</div>
      </div>
    </div>
  );
};

export default AboutPage;
